  TypesDiv: `WagonSedanHatchback, 3dr`,
  TextsDiv: `The model is a cheap at the price, but well-designed station wagon from the category "compact", which was included in the class of cars "from 1.5 to 1.8 liters." In 1996, it appeared as a type of sedan car, and gained great popularity due to its sporty appearance. This view, in turn, was largely due to the presence of three windows on each side, as happens with a sedan.  It turned out to be 150 mm longer than the sedan.
  The front-wheel drive vehicle modification is driven by a 1.5-liter 4-cylinder SOHC engine or a 1.8-liter 4-cylinder DOHC engine. The all-wheel drive version is equipped with a 1.6-liter engine. That is, the lineup had the same composition as when this model was present on the market as a sedan. Initially, the cheapest car, however, was equipped with air conditioning, power steering, electric door glass lifts, a remote lock, etc.  etc. And all this was included in the price, which amounted to only 1 million 230 thousand yen.

  In 1997, a new modification of the 1800 Aero appeared on sale, which was distinguished by additional details that improve the aerodynamics of the body, 15-inch aluminum wheels made by Italia Speed ​​Line, tinted windows. Inside the cabin, round instrument indicators with white dials and bucket seats of a sporty type were installed; the steering wheel was trimmed with genuine leather, just like the handle of the transmission control lever.  In 1998, the lineup underwent a small modernization, during which the car added massive headlights and a front grille with an original pattern. These innovations greatly changed the appearance of the car, making you think that before you is a completely new model. 
                                                    
No description

No description`,
